/* simple clean */
*{
  box-sizing: border-box;
  margin: 0;
  padding: 0;
}


html, body{
  height: 100%;
  width: 100%;
  overflow: hidden;
  /* background: #303346; */
}

.page{
  height: 100%;
  width: 100%;
  display: flex;
  flex-wrap: wrap;
  /* background: #303346; */
}

/* areas */
.area{
  transition: all 0.25s ease-in-out
}
.area-01{
  background: #303346;
  width: 50%;
  height: 33.45%;
}
.area-02{
  background: #d1c7b2;
  width: 50%;
  height: 66.6%;
}
.area-03{
  width: 100%;
  height: 33.4%;
}
@media (min-width:768px) {
  .area-01{
    height: 35%;
  }
}
@media (min-width:1024px) {
  .area-01{
    width: 25%;
    height: 50%;
  }
  .area-02{
    width: 75%;
    height: 69.3%;
  }
  .area-03{
    height: 30.7%;
  }
}
